import styles from './MenuItem.module.scss'

function MenuItem({data, children}) {

    const checkIcon = (icon, title) => {
        if(data.icon) {
            return (
                <>
                    {data.icon}
                    <p>{data.title}</p>
                </>
            )
        }
    }
    return (
        <div>
            <span className={styles['left-icon']}>{data.iconSeeMore}</span>
            {data.title}            
        </div>
     );
}

export default MenuItem;
